function TipsQuiz() {
  return (
    <div className="tips-quiz">
      <h2>Tips & Quiz</h2>
      <p>Here are some quick tips to remember:</p>
      <ul>
        <li>Always read food labels.</li>
        <li>If unsure, ask an adult before eating.</li>
        <li>Keep your plate safe by avoiding allergens.</li>
      </ul>
      {/* Quiz functionality can be added here */}
    </div>
  );
}

